using leetcode_sharp;

namespace UnitTests;

[TestFixture]
public class S00567Tests
{
    [Test]
    public void T1()
    {
        var sut = new S00567();
        sut.CheckInclusion("ab", "eidbaooo").Should().BeTrue();
    }

    [Test]
    public void T2()
    {
        var sut = new S00567();
        sut.CheckInclusion("ab", "eidboaoo").Should().BeFalse();
    }

    [Test]
    public void T3()
    {
        var sut = new S00567();
        sut.CheckInclusion("a", "ab").Should().BeTrue();
    }

    [Test]
    public void T4()
    {
        var sut = new S00567();
        sut.CheckInclusion("adc", "dcda").Should().BeTrue();
    }

    [Test]
    public void T5()
    {
        var sut = new S00567();
        sut.CheckInclusion("", "").Should().BeTrue();
    }

    [Test]
    public void T6()
    {
        var sut = new S00567();
        sut.CheckInclusion("ab", "a").Should().BeFalse();
    }
}